$(function() {
	var isMyFaceUrl = $("#myFaceUrl").val();
	if (isMyFaceUrl !== "") {
		var imgSrc = $("#myFaceUrl").val();
	} else {
		var imgSrc = 'data:image/jpg;base64,';
	}
	//上传头像设置
	var options ={
		thumbBox: '.thumbBox',
		spinner: '.spinner',
		imgSrc: imgSrc
	}
	var cropper = $('.imageBox').cropbox(options);
	$('#upload-file').on('change', function(){
		var file_size = this.files[0].size;
		var size = file_size / 1024;
		if (size > 1024) {
			num02 = size.toFixed(2);
			//提示处理
			var msg = "图片文件大小超过限制。请上传小于1M的文件，当前文件大小为"+num02+"KB";
			_alert("提示",msg);
			return false;
		}
		var filepath=this.files[0].name;
		var extStart=filepath.lastIndexOf(".");
		var ext=filepath.substring(extStart,filepath.length).toUpperCase();
		if(ext!=".BMP"&&ext!=".PNG"&&ext!=".GIF"&&ext!=".JPG"&&ext!=".JPEG"){
			//兼容后台提示处理
			var msg = "图片限于bmp,png,gif,jpeg,jpg格式";
			_alert("提示",msg);
			return false;
		}
		var reader = new FileReader();
		reader.onload = function(e) {
			var imgData = e.target.result;
			options.imgSrc = imgData;
			cropper = $('.imageBox').cropbox(options);
		}
		reader.readAsDataURL(this.files[0]);
		this.files = [];
	});
	$('#btnCrop').on('click', function(){
		var img200 = cropper.getDataURL(1);
		var img400 = cropper.getDataURL(2);
		var img600 = cropper.getDataURL(3);
		$("#imgData").val(img600);
		$('.cropped').html('');
		$('.cropped').append('<img src="'+img200+'" align="absmiddle" style="width:64px;margin-top:4px; border:1px solid #ddd;" ><p>50px*50px</p>');
		$('.cropped').append('<img src="'+img400+'" align="absmiddle" style="width:128px;margin-top:4px; border:1px solid #ddd;"><p>100px*100px</p>');
		$('.cropped').append('<img src="'+img600+'" align="absmiddle" style="width:180px;margin-top:4px; border:1px solid #ddd;"><p>200px*200px</p>');
	});
	$('#btnZoomIn').on('click', function(){
		cropper.zoomIn();
	})
	$('#btnZoomOut').on('click', function(){
		cropper.zoomOut();
	});
});